INSERT INTO `actor` (`act_id`, `full_name`, `alias`, `gender`, `birth_day`, `place_of_birth`, `avatar`, `bio`, `is_removed`, `created_at`, `updated_at`) VALUES
(1245,	'Scarlett Johansson',	'1245-scarlett-johansson',	0,	'1984-11-22',	'New York City, New York, USA',	'https://www.themoviedb.org/t/p/w300_and_h450_bestv2/6bBCPmc55gzP7TR9Th4WbykrYd0.jpg',	'Scarlett Ingrid Johansson (born November 22, 1984) is an American actress. The world\'s highest-paid actress in 2018 and 2019, she has featured multiple times on the Forbes Celebrity 100 list. Her films have grossed over $14.3 billion worldwide, making Johansson the ninth-highest-grossing box office star of all time. She has received various accolades, including a Tony Award and a British Academy Film Award, in addition to nominations for two Academy Awards and five Golden Globe Awards.',	0,	'2010-10-26 21:30:10',	NULL),
(1341,	'Donnie Yen',	'1341-donnie-yen',	1,	'1963-07-27',	'Yuexiu District, Guangzhou, China',	'https://www.themoviedb.org/t/p/w300_and_h450_bestv2/hTlhrrZMj8hZVvD17j4KyAFWBHc.jpg',	'Donnie Yen (Chinese: 甄子丹; born 27 July 1963) is a Hong Kong actor, martial artist, film director, action choreographer and film producer. Apart from being a well-known film and television actor in Hong Kong, Yen has also gained international recognition for appearing in many films together with other prominent and internationally-known actors such as Jackie Chan, Jet Li and Michelle Yeoh.',	0,	'2006-03-26 12:30:10',	NULL),
(3223,	'Robert Downey Jr.',	'3223-robert-downey-jr',	1,	'1965-04-04',	'New York City, New York, USA',	'https://www.themoviedb.org/t/p/w300_and_h450_bestv2/im9SAqJPZKEbVZGmjXuLI4O7RvM.jpg',	'Robert John Downey Jr. (born April 4, 1965) is an American actor and producer. His career has been characterized by critical and popular success in his youth, followed by a period of substance abuse and legal troubles, before a resurgence of commercial success later in his career. In 2008, Downey was named by Time magazine among the 100 most influential people in the world, and from 2013 to 2015, he was listed by Forbes as Hollywood\'s highest-paid actor.',	0,	'2010-03-13 23:30:10',	NULL),
(6384,	'Keanu Reeves',	'6384-keanu-reeves',	1,	'1964-09-02',	'Beirut, Lebanon',	'https://www.themoviedb.org/t/p/w300_and_h450_bestv2/rRdru6REr9i3WIHv2mntpcgxnoY.jpg',	'Keanu Charles Reeves is a Canadian actor. Reeves is known for his roles in Bill & Ted\'s Excellent Adventure, Speed, Point Break, and The Matrix franchise as Neo. He has collaborated with major directors such as Stephen Frears (in the 1988 period drama Dangerous Liaisons); Gus Van Sant (in the 1991 independent film My Own Private Idaho); and Bernardo Bertolucci (in the 1993 film Little Buddha). Referring to his 1991 film releases, The New York Times\' critic, Janet Maslin, praised Reeves\' versatility, saying that he \'displays considerable discipline and range.',	0,	'2010-10-20 10:30:10',	NULL),
(8691,	'Zoe Saldaña',	'8691-zoe-saldana',	0,	'1978-06-19',	'Passaic, New Jersey, USA',	'https://www.themoviedb.org/t/p/w300_and_h450_bestv2/iOVbUH11il632nj2v01NCtYYeSg.jpg',	'Zoe Yadira Saldaña-Perego (née Saldaña Nazario; born June 19, 1978) is an American actress. After performing with the theater group Faces she appeared in two 1999 episodes of Law & Order. Her film career began a year later with Center Stage (2000) in which she portrayed a ballet dancer.',	0,	'2010-02-24 14:35:10',	NULL),
(12835,	'Vin Diesel',	'12835-vin-diesel',	1,	'1967-07-18',	'Alameda County, California, USA',	'https://www.themoviedb.org/t/p/w300_and_h450_bestv2/7rwSXluNWZAluYMOEWBxkPmckES.jpg',	'Mark Sinclair (born July 18, 1967), known professionally as Vin Diesel, is an American actor and producer. One of the world\'s highest-grossing actors, he is best known for playing Dominic Toretto in the Fast & Furious franchise.',	0,	'2010-09-28 11:30:10',	NULL),
(15735,	'Helen Mirren',	'15735-helen-mirren',	0,	'1945-07-26',	'Hammersmith, London, England, UK',	'https://www.themoviedb.org/t/p/w300_and_h450_bestv2/1reKRrsdsHXJaRVHVyOEg4oPTcZ.jpg',	'Dame Helen Lydia Mirren DBE (née Mironoff; born 26 July 1945) is an English actor. The recipient of numerous accolades, she is the only person to achieve the Triple Crown of Acting in both the United States and the United Kingdom. She received an Academy Award and a British Academy Film Award for her portrayal of Queen Elizabeth II in The Queen, a Tony Award and a Laurence Olivier Award for the same role in The Audience, three British Academy Television Awards for her performance as DCI Jane Tennison in Prime Suspect, and four Primetime Emmy Awards, including two for Prime Suspect.',	0,	'2013-04-29 21:30:10',	NULL),
(16828,	'Chris Evans',	'16828-chris-evans',	1,	'1981-06-13',	'Sudbury, Massachusetts, USA',	'https://www.themoviedb.org/t/p/w300_and_h450_bestv2/3bOGNsHlrswhyW79uvIHH1V43JI.jpg',	'Christopher Robert Evans (born June 13, 1981) is an American actor. He began his career with roles in television series, such as in Opposite Sex in 2000. Following appearances in several teen films including 2001\'s Not Another Teen Movie, he gained attention for his portrayal of Marvel Comics character the Human Torch in 2005\'s Fantastic Four, and its sequel Fantastic Four: Rise of the Silver Surfer (2007). Evans made further appearances in film adaptations of comic books and graphic novels: TMNT (2007), Scott Pilgrim vs. the World (2010), and Snowpiercer (2013).',	0,	'2012-09-26 19:30:10',	NULL),
(62561,	'Tessa Thompson',	'62561-tessa-thompson',	0,	'1983-10-03',	'Los Angeles, California, USA',	'https://www.themoviedb.org/t/p/w300_and_h450_bestv2/7IDARj5sBzK3xlAQ6YSbNflBZIv.jpg',	'Tessa Lynne Thompson (born October 3, 1983) is an American actress, producer, singer, and songwriter. She began her professional acting career with the Los Angeles Women\'s Shakespeare Company while studying at Santa Monica College. She appeared in productions of The Tempest and Romeo and Juliet, the latter of which earned her a NAACP Theatre Award nomination. Her breakthrough came with leading roles in Tina Mabry\'s independent drama film Mississippi Damned (2009) and Tyler Perry\'s drama film For Colored Girls (2010).',	0,	'2014-07-30 12:23:10',	NULL),
(65731,	'Sam Worthington',	'65731-sam-worthington',	1,	'1976-08-02',	'Godalming, Surrey, England, UK',	'https://www.themoviedb.org/t/p/w300_and_h450_bestv2/blKKsHlJIL9PmUQZB8f3YmMBW5Y.jpg',	'Samuel Henry John Worthington (born 2 August 1976) is a British-Australian actor. He is best known for playing Jake Sully in Avatar, Marcus Wright in Terminator Salvation, and Perseus in Clash of the Titans and its sequel Wrath of the Titans. He later took more dramatic roles, appearing in The Debt (2010), Everest (2015), Hacksaw Ridge (2016), The Shack (2017), Manhunt: Unabomber (2017), and Fractured (2019).',	0,	'2013-03-25 19:30:10',	NULL),
(69899,	'Zachary Levi',	'69899-zachary-levi',	1,	'1980-09-29',	'Lake Charles, Louisiana, USA',	'https://www.themoviedb.org/t/p/w300_and_h450_bestv2/1W8L3kEMMPF9umT3ZGaNIiCYKfZ.jpg',	'Zachary Levi Pugh (/ˈzækəri ˈliːvaɪ/; born September 29, 1980) is an American actor, comedian, and singer. He received critical acclaim for starring as Chuck Bartowski in the series Chuck, and as the title character in Shazam! and its 2022 sequel, as a part of the DC Extended Universe.',	0,	'2016-01-15 11:30:10',	NULL),
(73457,	'Chris Pratt',	'73457-chris-pratt',	1,	'1979-06-21',	'Virginia, Minnesota, USA',	'https://www.themoviedb.org/t/p/w300_and_h450_bestv2/83o3koL82jt30EJ0rz4Bnzrt2dd.jpg',	'Christopher Michael Pratt (born 21 June 1979) is an American actor, known for starring in both television and action films. He rose to prominence for his television roles, particularly in the NBC sitcom Parks and Recreation (2009–2015), for which he received critical acclaim and was nominated for the Critics\' Choice Television Award for Best Supporting Actor in a Comedy Series in 2013.',	0,	'2010-09-28 10:24:10',	NULL),
(135651,	'Michael B. Jordan',	'135651-michael-b-jordan',	1,	'1987-02-09',	'Santa Ana, California, USA',	'https://www.themoviedb.org/t/p/w300_and_h450_bestv2/kfcn0yyEdN2aJfVaxW0NIoKVF4J.jpg',	'Michael Bakari Jordan (/bɑːˈkɑːriː/; born February 9, 1987) is an American actor and producer. He is known for his film roles as shooting victim Oscar Grant in the drama Fruitvale Station (2013), boxer Donnie Creed in Creed (2015), and Erik Killmonger in Black Panther (2018), all three of which were directed by Ryan Coogler. Jordan reprised the role of Creed in Creed II (2018), and is set to star, and make his directorial debut, in Creed III (2022).',	0,	'2012-08-19 11:30:10',	NULL),
(1674162,	'Jonathan Majors',	'1674162-jonathan-majors',	1,	'1989-09-07',	'Dallas, Texas, USA',	'https://www.themoviedb.org/t/p/w300_and_h450_bestv2/nsxnMbkl9Lpc12AmYwKi9SmsJ7e.jpg',	'Jonathan Majors (born September 7, 1989) is an American actor, best known for his roles in The Last Black Man in San Fransisco (2019), The Harder They Fall (2021), Devotion (2022), and as Kang the Conqueror in the Marvel Cinematic Universe.',	0,	'2014-03-26 11:30:10',	NULL);
