INSERT INTO `movie` (`movie_id`, `movie_name`, `alias`, `trailer`, `short_desc`, `overview`, `poster`, `backdrops`, `runtime`, `country`, `language`, `age_id`, `release_date`, `hot`, `comming_soon`, `now_showing`, `is_removed`, `created_at`, `updated_at`) VALUES
(12202,	'Avatar: The Way of Water',	'avatar-the-way-of-water',	'https://www.youtube.com/embed/d9MyW72ELq0',	'Câu chuyện của “Avatar: Dòng Chảy Của Nước” lấy bối cảnh 10 năm sau những sự kiện xảy ra ở phần đầu tiên. Phim kể câu chuyện về gia đình mới của Jake Sully (Sam Worthington thủ vai) cùng những rắc rối theo sau và bi kịch họ phải chịu đựng khi phe loài người xâm lược hành tinh Pandora.',	'Đặt hơn một thập kỷ sau các sự kiện của bộ phim đầu tiên, hãy tìm hiểu câu chuyện về gia đình Sully (Jake, Neytiri và những đứa trẻ của họ), những rắc rối sau đó để sống sót, và những bi kịch mà họ chịu đựng.',	'https://www.cgv.vn/media/catalog/product/cache/1/image/c5f0a1eff4c394a251036189ccddaacd/a/v/avatar_2_payoff_posster_2_.jpg',	'https://www.themoviedb.org/t/p/w533_and_h300_bestv2/ovM06PdF3M8wvKb06i4sjW3xoww.jpg',	192,	'US',	'Tiếng Anh - Phụ đề Tiếng Việt',	1,	'16/12/2022',	1,	0,	1,	0,	'2023-03-20 13:36:20',	NULL),
(12203,	'SHAZAM! CƠN THỊNH NỘ CỦA CÁC VỊ THẦN',	'shazam-fury-of-the-gods',	'https://www.youtube.com/watch?v=lPmzBaNJUzI',	'Một tác phẩm từ New Line Cinema mang tên “Shazam! Fury of the Gods,” tiếp tục câu chuyện về chàng trai Billy Batson, và bản ngã Siêu anh hùng trưởng thành của mình sau khi hô cụm từ “SHAZAM !,” ma thuật.',	'Billy Batson và anh chị em nuôi của mình, người biến thành các siêu anh hùng bằng cách nói \'Shazam!\', Bị buộc phải quay lại hành động và chiến đấu với các cô con gái của Atlas, người mà họ phải dừng lại sử dụng vũ khí có thể phá hủy thế giới.',	'https://www.cgv.vn/media/catalog/product/cache/1/image/c5f0a1eff4c394a251036189ccddaacd/s/h/shazam_fotg_payoff_poster_1_.jpg',	'https://www.themoviedb.org/t/p/w533_and_h300_bestv2/wybmSmviUXxlBmX44gtpow5Y9TB.jpg',	130,	'US',	'Tiếng Anh - Phụ đề Tiếng Việt',	1,	'17/03/2023',	1,	0,	1,	0,	'2023-03-22 17:36:23',	NULL),
(12204,	'THANH GƯƠM DIỆT QUỶ: ĐƯỜNG ĐẾN LÀNG RÈN GƯƠM',	'demon-slayer',	'https://www.youtube.com/watch?v=IbyYUvLZ6fM&feature=youtu.be',	'Thanh Gươm Diệt Quỷ: Đường Đến Làng Rèn Gươm sẽ tái hiện trận chiến khốc liệt nhất tại Phố Đèn Đỏ trong tập 10 và 11 giữa Tanjiro, Sound Hashira, Tengen Uzui với anh em Thượng Huyền Lục - Daki và Gyutaro lần đầu tiên trên màn ảnh rộng. Bên cạnh đó, phim sẽ công chiếu tập 1 của Làng Rèn Gươm: Sau trận chiến khốc liệt với anh em quỷ Thượng Huyền Lục Gyuutarou và Daki tại Phố Đèn Đỏ, Tanjiro và các kiếm sĩ diệt quỷ đều bị thương nặng và được đưa trở về trụ sở của Đội Diệt Quỷ để dưỡng thương và phục hồi.',	'Sau khi gia đình anh ta bị sát hại một cách tàn nhẫn, một cậu bé tốt bụng tên là Tanjiro Kamado quyết tâm trở thành một kẻ giết quỷ với hy vọng biến em gái Nezuko trở lại con người. Cùng với các đồng chí của mình, Zenitsu và Inosuke, cùng với một trong những thành viên hàng đầu của Quân đoàn Slayer Demon, Tengen Uzui, Tanjiro bắt đầu một nhiệm vụ trong khu giải trí, nơi họ gặp phải Gyutaro.',	'https://www.cgv.vn/media/catalog/product/cache/1/image/c5f0a1eff4c394a251036189ccddaacd/d/e/demon-slayer-poster.jpg',	'https://www.themoviedb.org/t/p/w533_and_h300_bestv2/tcYO8ay3A0liCWxHu2creU3Q9IB.jpg',	110,	'JP',	'Tiếng Nhật - Phụ đề Tiếng Việt',	1,	'22/03/2023',	1,	0,	1,	0,	'2023-03-19 09:36:23',	NULL),
(12205,	'SIÊU LỪA GẶP SIÊU LẦY',	'sieu-lua-gap-sieu-lay',	'https://www.youtube.com/watch?v=kdn0xrDf8tY&feature=youtu.be',	'Thuộc phong cách hành động – hài hước với các “cú lừa” thông minh và lầy lội đến từ bộ đôi Tú (Anh Tú) và Khoa (Mạc Văn Khoa), Siêu Lừa Gặp Siêu Lầy của đạo diễn Võ Thanh Hòa theo chân của Khoa – tên lừa đảo tầm cỡ “quốc nội” đến đảo ngọc Phú Quốc với mong muốn đổi đời.',	'Thuộc phong cách hành động – hài hước với các “cú lừa” thông minh và lầy lội đến từ bộ đôi Tú (Anh Tú) và Khoa (Mạc Văn Khoa), Siêu Lừa Gặp Siêu Lầy của đạo diễn Võ Thanh Hòa theo chân của Khoa – tên lừa đảo tầm cỡ “quốc nội” đến đảo ngọc Phú Quốc với mong muốn đổi đời. Tại đây, Khoa gặp Tú – tay lừa đảo “hàng real” và cùng Tú thực hiện các phi vụ từ nhỏ đến lớn. Cứ ngỡ sự ranh mãnh của Tú và sự may mắn trời cho của Khoa sẽ giúp họ trở thành bộ đôi bất khả chiến bại, nào ngờ lại đối mặt với nhiều tình huống dở khóc – dở cười. Nhất là khi băng nhóm của bộ đôi nhanh chóng mở rộng vì sự góp mặt của ông Năm (Nhất Trung) và bé Mã Lai (Ngọc Phước).',	'https://www.cgv.vn/media/catalog/product/cache/1/image/c5f0a1eff4c394a251036189ccddaacd/r/s/rsz_700x1000_1.jpg',	'https://ngaymoionline-cdn.mastercms.vn/stores/news_dataimages/2023/032023/02/14/maxresdefault-cleanup20230302140940.jpg?rt=20230302140941',	112,	'VN',	'Tiếng Việt - Phụ đề Tiếng Anh',	3,	'03/03/2023',	1,	0,	1,	0,	'2023-02-22 11:36:33',	NULL),
(12206,	'FAST AND FURIOUS X',	'fast-and-furious-x',	'https://www.youtube.com/watch?v=Jphd23nUCLs',	'Dom Toretto và gia đình của anh ấy bị trở thành mục tiêu của người con trai đầy thù hận của ông trùm ma túy Hernan Reyes.',	'Dom Toretto và gia đình của anh ấy bị trở thành mục tiêu của người con trai đầy thù hận của ông trùm ma túy Hernan Reyes.Và cuộc chiến bảo vệ gia đình của DOM chính thức bắt đàu',	'https://www.cgv.vn/media/catalog/product/cache/1/image/c5f0a1eff4c394a251036189ccddaacd/f/a/fast_x_700x1000px.jpg',	'https://images2.thanhnien.vn/thumb_w/640/528068263637045248/2023/2/11/ovffxtrlathumbnailffxhd-16760785682151893462097.jpg',	NULL,	'US',	'Tiếng Anh - Phụ đề Tiếng Việt',	4,	'19/05/2023',	1,	1,	0,	0,	'2023-03-25 14:10:23',	NULL),
(12207,	'Vệ binh dãy ngân hà 3',	've-binh-day-ngan-ha-3',	'https://www.youtube.com/watch?v=Jphd23nUCLs',	'Cho dù vũ trụ này có bao la đến đâu, các Vệ Binh của chúng ta cũng không thể trốn chạy mãi mãi',	'Cho dù vũ trụ này có bao la đến đâu, các Vệ Binh của chúng ta cũng không thể trốn chạy mãi mãi. Vệ Binh Dải Ngân Hà 3 dự kiến khởi chiếu tại rạp từ 05.05.2023.',	'https://www.cgv.vn/media/catalog/product/cache/1/image/c5f0a1eff4c394a251036189ccddaacd/r/s/rsz_gotg3_-_payoff_poster.jpg',	'http://genk.mediacdn.vn/thumb_w/660/2018/10/20/photo-1-1540018246468599888897.jpg',	NULL,	'US',	'Tiếng Anh - Phụ đề Tiếng Việt',	3,	'05/05/2023',	1,	1,	0,	0,	'2023-03-23 21:10:23',	NULL),
(12208,	'Lật mặt 6: Tấm vé định mệnh',	'lat-mat-6',	'https://www.youtube.com/watch?v=OobBWy3avUo',	'Lật mặt 6 sẽ thuộc thể loại giật gân, tâm lý pha hành động, hài hước.',	'Lật mặt 6 sẽ thuộc thể loại giật gân, tâm lý pha hành động, hài hước. Hứa hẹn sẽ mang lại nhiều tiếng cười đan xen với đó là những pha hành động mản nhãn người xem',	'https://www.cgv.vn/media/catalog/product/cache/1/image/c5f0a1eff4c394a251036189ccddaacd/l/m/lm6_teaser_poster.jpg',	'https://tintuc-divineshop.cdn.vccloud.vn/wp-content/uploads/2023/02/can-biet-gi-ve-bo-phim-dien-anh-lat-mat-6-tam-ve-dinh-menh_63fdd722064cd.jpeg',	NULL,	'VN',	'Tiếng Việt - Phụ đề Tiếng Anh',	3,	'28/04/2023',	1,	1,	0,	0,	'2023-03-28 05:10:23',	NULL),
(12209,	'Đảo tội ác',	'dao-toi-ac',	'https://www.youtube.com/watch?v=8xk-X2AOr1U',	'Nhóm du khách trẻ vô tình phá bỏ phong ấn của con quái vật khát máu khi đến tham quan một hòn đảo cấm không dân địa phương nào dám đặt chân đến',	'Nhóm du khách trẻ vô tình phá bỏ phong ấn của con quái vật khát máu khi đến tham quan một hòn đảo cấm không dân địa phương nào dám đặt chân đến. Liệu họ có thể bình an thoát khỏi hay đó sẽ là nơi chôn vùi tất cả?',	'https://www.cgv.vn/media/catalog/product/cache/1/image/c5f0a1eff4c394a251036189ccddaacd/4/x/4x5-dao-toi-ac.jpg',	'https://www.cgv.vn/media/catalog/product/cache/1/image/1800x/71252117777b696995f01934522c402d/p/u/pulau_1920x1080_1_.jpg',	NULL,	'ML',	'Tiếng Anh & Tiếng Malay - Phụ đề Tiếng Việt',	4,	'31/03/2023',	1,	1,	0,	0,	'2023-03-15 19:23:22',	NULL),
(12210,	'CREED III: TAY ĐẤM HUYỀN THOẠI',	'creed-3',	'https://www.youtube.com/watch?v=ir0lrq1IBtw',	'Sau khi thống trị thế giới quyền anh, Adonis Creed đã phát triển mạnh mẽ trong cả sự nghiệp và cuộc sống gia đình. Khi một người bạn thời thơ ấu và cựu thần đồng quyền anh, Damian (Jonathan Majors), tái xuất sau khi thụ án tù dài hạn, anh ta háo hức chứng minh rằng mình xứng đáng được trở lại võ đài.',	'Cuộc chạm trán giữa những người bạn cũ không chỉ là một cuộc chiến trên võ đài thông thường. Để có thể chiến thắng, Adonis phải đặt tương lai của mình lên trên hết để chiến đấu với Damian — một võ sĩ không còn gì để mất.',	'https://www.cgv.vn/media/catalog/product/cache/1/image/c5f0a1eff4c394a251036189ccddaacd/p/o/poster_creed.jpg',	'https://www.themoviedb.org/t/p/w533_and_h300_bestv2/x6h9sm7dIz7EjEZNCzKZb9tMlzP.jpg',	117,	'US',	'Tiếng Anh - Phụ đề Tiếng Việt',	1,	'24/03/2023',	1,	0,	1,	0,	'2023-03-20 10:36:20',	NULL),
(12211,	'65: TRẬN CHIẾN THỜI TIỀN SỬ',	'65-tran-chien-thoi-tien-su',	'https://www.youtube.com/watch?v=5ieCIed2At0',	'Sau cú va chạm thảm khốc, tàu vũ trụ của Mills (Adam Driver) bay thẳng đến một hành tinh không xác định. Với kiến thức nhạy bén của mình, Mills nhanh chóng nhận ra hành tinh không xác định này chính là Trái Đất của 65 triệu năm trước.',	'Liệu với những công nghệ tương lai đang có, Mills có thể sống sót trước những loài khủng long và sinh vật tiền sử đáng sợ? 65 - Trận Chiến Thời Tiền Sử đến từ bộ đôi biên kịch từng tạo nên “A Quiet Place” và được nhào nặn bởi chính NSX nổi tiếng Sam Raimi. Và, với vai chính được thủ vai bởi diễn viên từng đoạt giải Oscar - Adam Driver.',	'https://www.cgv.vn/media/catalog/product/cache/1/image/c5f0a1eff4c394a251036189ccddaacd/p/o/poster_50x70_2_.jpg',	'https://www.themoviedb.org/t/p/w533_and_h300_bestv2/8H2O044M0xp240emFWAXjZsfLLx.jpg',	93,	'US',	'Tiếng Anh - Phụ đề Tiếng Việt',	1,	'10/03/2023',	0,	0,	1,	0,	'2023-03-01 08:00:20',	NULL),
(12212,	'Avengers: Endgame',	'end-game',	'https://www.youtube.com/embed/TcMBFSGVi1c',	'After the devastating events of Avengers: Infinity War (2018), the universe is in ruins',	'After the devastating events of Avengers: Infinity War (2018), the universe is in ruins. With the help of remaining allies, the Avengers assemble once more in order to reverse Thanos\' actions and restore balance to the universe.',	'https://movienew.cybersoft.edu.vn/hinhanh/avengers-endgame_gp03.jpeg',	'https://www.themoviedb.org/t/p/w533_and_h300_bestv2/7RyHsO4yDXtBv1zUU3mTpHeQ0d5.jpg',	181,	'US',	'Tiếng Anh - Phụ đề Tiếng Việt',	1,	'26/04/2019',	1,	0,	1,	0,	'2019-03-20 09:00:20',	NULL),
(12213,	'ĐIỀU ƯỚC CUỐI CỦA TÙ NHÂN 2037',	'dieu-uoc-cuoi-cua-tu-nhan-2037',	'https://youtu.be/B9wYFIlMuBk',	'Điều Ước Cuối Của Tù Nhân 2037 kể về tuổi 19, thay vì đến trường như bao bạn bè đồng trang lứa, Yoon-yeong phải nỗ lực hết mình để đi làm thêm kiếm tiền. Khao khát một cuộc sống tốt đẹp hơn cho mình và người mẹ khiếm thính, Yoon-yeong đặt mục tiêu thi đỗ kỳ thi công chức lên trên hết.',	'Bất ngờ và trớ trêu thay, một sự cố khủng khiếp xảy ra, biến Yoon-yeong từ nạn nhân đáng thương trở thành kẻ giết người. Trong thời điểm tuyệt vọng và bất lực nhất, Yoon-yeong đã gặp những người chị em trong phòng giam số 12. Đằng sau mỗi người là một câu chuyện khác nhau, nhưng họ đã trao nhau tình yêu thương và niềm hy vọng để cùng hướng về một tương lai tươi sáng ngoài song sắt nhà tù.',	'https://m.media-amazon.com/images/M/MV5BZjM5ZGFjMjQtOTFkMi00MzRkLWI3NGItZTFiYTdkYmE5ZTZlXkEyXkFqcGdeQXVyNjk1NzU1Mjk@._V1_FMjpg_UX1000_.jpg',	'https://www.themoviedb.org/t/p/w533_and_h300_bestv2/jgSrXBqLTqCoW2NX0mtAZggiqkY.jpg',	126,	'KR',	'Tiếng Hàn - Phụ đề Tiếng Việt',	3,	'06/08/2022',	0,	0,	1,	0,	'2023-07-23 14:49:20',	NULL),
(12214,	'John Wick - Chapter 4',	'john-wick-chapter-4',	'https://www.youtube.com/watch?v=qEVUtrk8_B4',	'Với giá trên đầu ngày càng tăng, John Wick phát hiện ra một con đường để đánh bại chiếc bàn cao. Nhưng trước khi anh ta có thể kiếm được sự tự do của mình, Wick phải đối mặt với một kẻ thù mới với các liên minh mạnh mẽ trên toàn cầu và các lực lượng biến những người bạn cũ thành kẻ thù.',	'With the price on his head ever increasing, legendary hit man John Wick takes his fight against the High Table global as he seeks out the most powerful players in the underworld, from New York to Paris to Japan to Berlin.',	'https://deadline.com/wp-content/uploads/2022/11/johnwick4-poster-key-art.jpg',	'https://www.themoviedb.org/t/p/w533_and_h300_bestv2/i8dshLvq4LE3s0v8PrkDdUyb1ae.jpg',	169,	'US',	'Tiếng Anh - Phụ đề Tiếng Việt',	4,	'24/03/2023',	1,	0,	1,	0,	'2023-02-23 15:49:20',	NULL);
